import React from "react";

const Navbar = () => {
  return (
    <nav className="navbar navbar-dark bg-primary navbar-expand-lg p-1">
      <div className="navbar-brand">Search</div>
      <ul className="navbar-nav">
        <li className="nav-item">
          <a href="#" className="nav-link">
            Главная
          </a>
        </li>
        <li className="nav-item">
          <a href="#" className="nav-link">
            Информация
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
